def solve(table):
    net_worth_geffen = 0
    net_worth_armani = 0
    for _, row in table.iterrows():
        if check(row['Name'][0], "David Geffen", '=='):
            net_worth_geffen = row['Net worth USDbn'][0]
        elif check(row['Name'][0], "Giorgio Armani", '=='):
            net_worth_armani = row['Net worth USDbn'][0]
        if check(net_worth_geffen, net_worth_armani, '>'):
            return "David Geffen"
        elif check(net_worth_geffen, net_worth_armani, '<'):
            return "Giorgio Armani"
        else:
            return "Both"
```

